class UnitTesting(unittest.TestCase):
    def test_one(self):
        s = Solution()
        i = 1
        o = ["()"]
        self.assertEqual(s.generateParenthesis(i), o)

    def test_two(self):
        s = Solution()
        i = 2
        o = ["(())","()()"]
        self.assertEqual(s.generateParenthesis(i), o)

    def test_three(self):
        s = Solution()
        i = 3
        o = sorted(["((()))","(()())","(())()","()(())","()()()"])
        self.assertEqual(sorted(s.generateParenthesis(i)), o)

